    customer_name: "Jean",
    restaurant_id: "333742",
    order_feedback:
      "I ordered the Cobb salad and fries. The food was good and the rating is more reflective of the experience with this order. \n\nWhen the food didn’t get here at the time promised I reached out to GB chat and was told the food was still being prepared. I was surprised that they didn’t offer to call or check with the restaurant since it had been an hour since I placed my order. \n\nI called the restaurant and they were quick and friendly and confirmed my food had been waiting for close to an hour for pick up.  \n\nWhen I shared this with GH customer service they told me the restaurant didn’t notify their system the food was ready so they couldnt do anything about it. At that point the customer service rep called the restaurant, and told me it would now be delivered. \n\nAfter almost another hour of waiting, I reached out to support again, who were able to confirm the order was on on the way. \n\nIm a monthly paid member. I’m usually a raving fan of GH. But this order took ~ 2 hours and multiple calls from a restaurant that’s 1.2 miles away from me.  \n\nAnd unlike other delivery platforms, when I have a crappy experience like this I don’t feel like there is any effort to improve the experience or comp me for my wasted time. \n\nI think if GH comped members they would track these failures and would implement systems to improve the communication process. For example, if delivery is way late and the order is still showing up as being prepared and a customer reached out bc they have a time constraint, maybe customer service can call the restaurant and check on it.\n\nI realize the customer service person was probably following protocol, but def room for improvement and I’m writing this review because it’s not the first time I have an experience like this.  \n\nPlease do better. ",
